import Foundation

class Solution {
    func minWindow(_ s: String, _ t: String) -> String {
        var t_count = t.reduce(into: Dictionary<Character, Int>()) { r, c in
            r[c, default: 0] += 1
        }
        var w_count = Dictionary<Character, Int>()
        
        func check() -> Bool{
            for (k, v) in t_count {
                if w_count[k] ?? 0 < v {
                    return false
                }
            }
            return true
        }
        
        var l = s.startIndex, r = s.startIndex, ans_l: String.Index? = nil
        var len = Int.max
        while r != s.endIndex {
            defer { r = s.index(after: r) }
            if t_count.keys.contains(s[r]) {
                w_count[s[r], default: 0] += 1
                
                if check() {
                    
                    while l <= r {
                        defer { l = s.index(after: l) }
                        
                        if s.distance(from: l, to: r) + 1 < len {
                            len = s.distance(from: l, to: r) + 1
                            ans_l = l
                        }
                        
                        if t_count.keys.contains(s[l]) {
                            w_count[s[l], default: 0] -= 1
                            if w_count[s[l]]! < t_count[s[l]]! {
                                break
                            }
                        }
                        
                    }
                }
                
            }
        }
        
        return ans_l == nil ? "" : String(s[ans_l!..<s.index(ans_l!, offsetBy: len)])
    }
}

